import React, { Component } from "react";

class NrBrand extends Component {
  render() {
    // console.log("B",this.props.nrWomenName)
    const { fifthbox } = this.props;
    return (
      <li className="nrBrandItem">
        <a className="nrBrandLink" href>
          {fifthbox}
        </a>
      </li>
    );
  }
}

export default NrBrand;
